webpackJsonp([0x82c766628453],{331:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Stephen Quick",author:"Stephen Quick"}},markdownRemark:{id:"c:/Users/stephen/Documents/Git/stepquick.github.io/src/pages/adding-upstream/index.md absPath of file >>> MarkdownRemark",html:'<p>I found this very useful in merging changes for Octopress, granted I ended up having to wipe the entire project out anyways.</p>\n<div class="gatsby-highlight">\n      <pre class="language-text"><code class="language-text">git remote add upstream https://github.com/imathis/octopress.git</code></pre>\n      </div>\n<p>This way I’m able to fetch anything that happens to the master of octopress by simply running</p>\n<div class="gatsby-highlight">\n      <pre class="language-text"><code class="language-text">git fetch upstream</code></pre>\n      </div>\n<p>If I want to go ahead and merge:</p>\n<div class="gatsby-highlight">\n      <pre class="language-text"><code class="language-text">git merge upstream/master</code></pre>\n      </div>\n<p>I can’t tell if there’s a difference between using https:// or git://, so I’m sticking to what github uses as an example.</p>',frontmatter:{title:"Fetching Upstream changes",date:"July 23, 2014"}}},pathContext:{slug:"/adding-upstream/",previous:{fields:{slug:"/start-nginx-at-launch-on-mavericks/"},frontmatter:{title:"Start nginx at launch on Mavericks Mac OS"}},next:{fields:{slug:"/force-regeneration-on-jekyll-watch/"},frontmatter:{title:"Force regeneration on jekyll watch"}}}}}});
